import React from 'react'
import { useHistory } from 'react-router-dom'

import {
  Layout,
  TitleContainer,
  Title,
} from './navbar.styles'

const Navbar = () => {
  const history = useHistory()

  return (
    <Layout><TitleContainer><img src='/assets/plaid_logo'/><Title>Dashboard</Title></TitleContainer></Layout>
  )
}


export default Navbar
